      "content": "com.markuspage.android.atimetracker\n.Tasks\n407f31f9478e944a426bbc6497056083\nandroid:id/parentPanel,android:id/button1,com.markuspage.android.atimetracker:id/credits,com.markuspage.android.atimetracker:id/about_dialog,com.markuspage.android.atimetracker:id/version,com.markuspage.android.atimetracker:id/usage,android:id/buttonPanel,android:id/customPanel,android:id/content,android:id/custom\nOK,Open Source Time Tracker, Detailed instructions are at https://github.com/netmackan/ATimeTracker\n\n \u2022 Create some tasks using the menu\n \u2022 Tap a task to start timing; tap it again to stop timing\n \u2022 Use the context menu for a task to list times\n \u2022 Change configuration options with the menu\n \u2022 View a weekly report with the menu\n \n Tapping a different task switches timing to the other task.\n \n The task context menu allows you to edit tasks (change their names), delete tasks (including all of the time history for that task!), or view the time log for that task.\n \n Time Log view\n \n The time log for a task is filtered on the same range that you selected for the main task view, so if you filtered the task view for This Week and you open the time log, then you'll only see times for this week. Use the Add Time menu item to manually insert times into the time log. Use the context menu for a time to delete or edit a time range.\n \n Note that TimeTracker will not prevent you from creating times that overlap with times in other (or the same) task. ,Version 1.0,A Time Tracker,Credits\n \n Based on TimeTracker+ by Sean E. Russell.\n Application icon from Tango Project (tango.freedesktop.org).\n Russian translation by Denis Gladkiy\n French translation by Wilfried Kopp\n Spanish and Italian translation by Carlos Manzo\n German translation by Philip Gilli\u00dfen "
